import styled from 'styled-components';
import { CartProvider, useCart } from "react-use-cart";
// import Home from './components/Home';

function Home() {
  const { addItem } = useCart();
  let [data, setData] = useState([]);

}

function App() {
  return (
    <CartProvider>
      <Container>
        <Home />
      </Container>
    </CartProvider>
  );
}

const Container = styled.div`
  color: #fff;
  height: 100vh;
  width: 100%;
`;

export default App;
